import React from "react";
import Newsletter from "./Newsletter";
import Navbar from "./Navbar";

function IT() {
  return (
    <div>
      <Navbar />
      <div className="w-full md:h-[500px] mx-auto  bg-[#F1F8FF] justify-center  items-center sm:h-[800px] ">
        <h1 className=" text-3xl  pt-20 pl-90 justify-center">
          "OLIVE cloud Platform (OCP) will provide reliable, responsive and
          transparent cloud services to the market"
        </h1>
      </div>
      <Newsletter />
    </div>
  );
}

export default IT;
